import {Panel, Div, Title, Text, Link} from "@vkontakte/vkui";
import './css/ThingsWithPhotoCalendarPage.css';

const ThingsWithPhotoCalendarPage = () =>{

    return(
        <Panel id="home"> 
            <Div className="mainThingsCalendar">
                <Div>Мои мысли...</Div>
                <Div></Div>
                <Div></Div>
                <Div className="rectanglePhoto">
                    <Div className="photoThingsCalendar"></Div>
                </Div>
                <Div className="burronThingsCalendar"></Div>
            </Div>
        </Panel>
    );
}

export default ThingsWithPhotoCalendarPage;
